import 'dart:io';

import 'package:flutter/material.dart';
import 'package:flutter_html_to_pdf/flutter_html_to_pdf.dart';
import 'package:path_provider/path_provider.dart';

import 'certificateDownload.dart';

class html_to_pdf extends StatefulWidget {
  const html_to_pdf({Key? key}) : super(key: key);

  @override
  State<html_to_pdf> createState() => _html_to_pdfState();
}

class _html_to_pdfState extends State<html_to_pdf> {
  String  cfData =
  """<head>
    <title>Proof of Education</title>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css">
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.16.0/umd/popper.min.js"></script>
    <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/js/bootstrap.min.js"></script>

    <style>
        .card {
            margin: 0 auto;
            float: none;
            margin-top: 30px;
            margin-bottom: 30px;
        }
    </style>

</head>

<body class="container">
    <div class="row text-center">
        <div class="col-md-6 text-center my-auto mx-auto">
            <div class="card text-center">
                <div class="card-body">
                    <h4 class="card-title center">ProofOfEduation</h4> <br />
                    <p class="card-text">Candidate Name: MerryD.</p>
                    <p class="card-text">Membership Number: MEM001</p>
                    <p class="card-text">Registration Number: REG10001</p>
                    <p class="card-text">Serial Number: 1</p>
                    <p class="card-text">BC Exam: Banking&amp;InsuranceExam</p>
                    <p class="card-text">Certificate Issued Date: 2022-03-16T16:00:00.000Z</p>
                </div>
                <img class="card-img-bottom" src="data:image/png;base64," alt="qr_code"
                    style="padding:10px; margin: 0 auto; width:50%; display: block;">
            </div>
        </div>
    </div>
</body>""";
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: Text("Html to Pdf"),),
      body: Center(
        child: Container(
          child: ElevatedButton(
            onPressed: () async{
              convert(cfData,"File Name");
              var targetPath2 = await _localPath;  //  file store path is required for open the file and send to the next screen

              Navigator.push(
                  context,
                  MaterialPageRoute(
                    builder: (context) => CertificateDownload(
                      certificateData: "File Name",certificatePath: targetPath2.toString(), // File name is that name that was open in next screen
                    ),
                  ));
            },
            child: Text("Html_to_pdf"),
          ),
        ),
      ),
    );
  }

  convert(String cfData, String name) async {  // Name is File Name that you want to give the file
    var targetPath = await _localPath;
    var targetFileName = name;

    var generatedPdfFile = await FlutterHtmlToPdf.convertFromHtmlContent(
        cfData, targetPath!, targetFileName);
    print(generatedPdfFile);
    ScaffoldMessenger.of(context).showSnackBar(SnackBar(
      content: Text(generatedPdfFile.toString()),
    ));
  }

  Future<String?> get _localPath async {
    Directory? directory;
    try {
      if (Platform.isIOS) {
        directory = await getApplicationSupportDirectory();
      } else {   // if platform is android
        directory = Directory('/storage/emulated/0/Download');
        if (!await directory.exists()) {
          directory = await getExternalStorageDirectory();
        }
      }
    } catch (err, stack) {
      print("Can-not get download folder path");
    }
    return directory?.path;
  }
}
